import React from "react";
import { Grid } from "@material-ui/core";

const About = () => {
    return(
        <React.Fragment>

           <Grid item xs = {12} container  spacing = {4}>
               <Grid item lg = {6} md = {6} sm = {12} xm = {12} ><h1 style = {{backgroundColor: 'black'}}>About me</h1></Grid>
               <Grid item lg = {6} md = {6} sm = {12} xm = {12} ><h1 style = {{backgroundColor: 'red'}}>About Status</h1></Grid>
           </Grid>

        </React.Fragment>
    );
}

export default About;
